import './App.css';
import DynamicCheckbox from './DynamicCheckbox';

import React, { useState } from 'react';
import axios from 'axios';

function FormComponent() {
  const [formData, setFormData] = useState({
    ano: '2001', // Define um valor padrão para o ano
    percent: '90', // Define um valor padrão para o percentual
    partido: 'Digite...' // Define um valor padrão para os partidos
  });

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    axios.post('http://127.0.0.1:5000/api/sendDados', formData)
      .then(response => {
        console.log('Resposta do servidor:', response.data);
      })
      .catch(error => {
        console.error('Erro ao enviar dados:', error);
      });
  };

  return (
    <form onSubmit={handleSubmit}>
      <div className="App-header">
        <Formulario formData={formData} handleInputChange={handleInputChange} />

      </div>

    </form>
  );
}

function LabelAnos(props){
  return (
        <label>
          Informe o ano a considerar ( de 2001 a 2023) :   
          <select
            name="ano"
            value={props.formData.ano}
            onChange={props.handleInputChange}
          >
          <option value="2001">2001</option>
          <option value="2002">2002</option>
          <option value="2003">2003</option>
          <option value="2004">2004</option>
          <option value="2005">2005</option>
          <option value="2006">2006</option>
          <option value="2007">2007</option>
          <option value="2008">2008</option>
          <option value="2009">2009</option>
          <option value="2010">2010</option>
          <option value="2011">2011</option>
          <option value="2012">2012</option>
          <option value="2013">2013</option>
          <option value="2014">2014</option>
          <option value="2015">2015</option>
          <option value="2016">2016</option>
          <option value="2017">2017</option>
          <option value="2018">2018</option>
          <option value="2019">2019</option>
          <option value="2020">2020</option>
          <option value="2021">2021</option>
          <option value="2022">2022</option>
          <option value="2023">2023</option>
      </select>
    </label>
  );
}

function Formulario(props){
  return (
    <div className='form'>
        <LabelAnos formData={props.formData} handleInputChange={props.handleInputChange} />
        <label>
        Informe o percentual mínimo de concordância ( threshold de 0 a 100):
         <input 
            name="percent"  
            value={props.formData.percent}
            onChange={props.handleInputChange} />
        </label>
        <label>Informe os partidos a analisar (separados por espaço):
        <input 
            type="text"
            name="partido" 
            value={props.formData.partido}
            onChange={props.handleInputChange} />
        </label>
        <button type="submit">Gerar Grafos</button>

    </div>
  );
}

export default FormComponent;
